import { Box, Typography } from "@mui/material";

const header = () =>{
    return(
        <Box sx={{margin: "16px 0px;", display:'flex', justifyContent:'center', alignItems:'center', height:'100vh'}}>
            <Typography sx={{fontSize:"24px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400'}}>
                PHOTOGRAPHER
            </Typography>
        </Box>
    );
}

export default header
